@testset "4.3.2.1 (a+b tan)^m (c+d tan)^n" begin
    @variables a, b, c, d, e, f, m, n, p, x

    #= ::Package:: =#

    #= ::Title::Closed:: =#
    #=Integrands*of*the*form*(a+b*tan(e+f*x))^m*(d*tan(e+f*x))^n=#


    #= ::Section::Closed:: =#
    #=Integrands*of*the*form*(a+im*a*tan(e+f*x))^m*(d*tan(e+f*x))^n=#


    #= ::Subsection::Closed:: =#
    #=Integrands*of*the*form*(a+im*a*tan(e+f*x))^m*(d*tan(e+f*x))^n=#


    #= ::Subsubsection::Closed:: =#
    #=m>0=#


    @test_int [tan(c + d*x)^5*(a + im*a*tan(c + d*x)), x, 6, (-im)*a*x - (a*log(cos(c + d*x)))/d + (im*a*tan(c + d*x))/d - (a*tan(c + d*x)^2)/(2*d) - ((im/3)*a*tan(c + d*x)^3)/d + (a*tan(c + d*x)^4)/(4*d) + ((im/5)*a*tan(c + d*x)^5)/d]
    @test_int [tan(c + d*x)^4*(a + im*a*tan(c + d*x)), x, 5, a*x - (im*a*log(cos(c + d*x)))/d - (a*tan(c + d*x))/d - ((im/2)*a*tan(c + d*x)^2)/d + (a*tan(c + d*x)^3)/(3*d) + ((im/4)*a*tan(c + d*x)^4)/d]
    @test_int [tan(c + d*x)^3*(a + im*a*tan(c + d*x)), x, 4, im*a*x + (a*log(cos(c + d*x)))/d - (im*a*tan(c + d*x))/d + (a*tan(c + d*x)^2)/(2*d) + ((im/3)*a*tan(c + d*x)^3)/d]
    @test_int [tan(c + d*x)^2*(a + im*a*tan(c + d*x)), x, 3, -(a*x) + (im*a*log(cos(c + d*x)))/d + (a*tan(c + d*x))/d + ((im/2)*a*tan(c + d*x)^2)/d]
    @test_int [tan(c + d*x)*(a + im*a*tan(c + d*x)), x, 2, (-im)*a*x - (a*log(cos(c + d*x)))/d + (im*a*tan(c + d*x))/d]
    @test_int [a + im*a*tan(c + d*x), x, 2, a*x - (im*a*log(cos(c + d*x)))/d]
    @test_int [cot(c + d*x)*(a + im*a*tan(c + d*x)), x, 2, im*a*x + (a*log(sin(c + d*x)))/d]
    @test_int [cot(c + d*x)^2*(a + im*a*tan(c + d*x)), x, 3, -(a*x) - (a*cot(c + d*x))/d + (im*a*log(sin(c + d*x)))/d]
    @test_int [cot(c + d*x)^3*(a + im*a*tan(c + d*x)), x, 4, (-im)*a*x - (im*a*cot(c + d*x))/d - (a*cot(c + d*x)^2)/(2*d) - (a*log(sin(c + d*x)))/d]
    @test_int [cot(c + d*x)^4*(a + im*a*tan(c + d*x)), x, 5, a*x + (a*cot(c + d*x))/d - ((im/2)*a*cot(c + d*x)^2)/d - (a*cot(c + d*x)^3)/(3*d) - (im*a*log(sin(c + d*x)))/d]
    @test_int [cot(c + d*x)^5*(a + im*a*tan(c + d*x)), x, 6, im*a*x + (im*a*cot(c + d*x))/d + (a*cot(c + d*x)^2)/(2*d) - ((im/3)*a*cot(c + d*x)^3)/d - (a*cot(c + d*x)^4)/(4*d) + (a*log(sin(c + d*x)))/d]
    @test_int [cot(c + d*x)^6*(a + im*a*tan(c + d*x)), x, 7, -(a*x) - (a*cot(c + d*x))/d + ((im/2)*a*cot(c + d*x)^2)/d + (a*cot(c + d*x)^3)/(3*d) - ((im/4)*a*cot(c + d*x)^4)/d - (a*cot(c + d*x)^5)/(5*d) + (im*a*log(sin(c + d*x)))/d]


    @test_int [tan(c + d*x)^4*(a + im*a*tan(c + d*x))^2, x, 6, 2*a^2*x - ((2*im)*a^2*log(cos(c + d*x)))/d - (2*a^2*tan(c + d*x))/d - (im*a^2*tan(c + d*x)^2)/d + (2*a^2*tan(c + d*x)^3)/(3*d) + ((im/2)*a^2*tan(c + d*x)^4)/d - (a^2*tan(c + d*x)^5)/(5*d)]
    @test_int [tan(c + d*x)^3*(a + im*a*tan(c + d*x))^2, x, 5, (2*im)*a^2*x + (2*a^2*log(cos(c + d*x)))/d - ((2*im)*a^2*tan(c + d*x))/d + (a^2*tan(c + d*x)^2)/d + (((2*im)/3)*a^2*tan(c + d*x)^3)/d - (a^2*tan(c + d*x)^4)/(4*d)]
    @test_int [tan(c + d*x)^2*(a + im*a*tan(c + d*x))^2, x, 3, -2*a^2*x + (2*im*a^2*log(cos(c + d*x)))/d + (a^2*tan(c + d*x))/d - (im*(a + im*a*tan(c + d*x))^3)/(3*a*d)]
    @test_int [tan(c + d*x)*(a + im*a*tan(c + d*x))^2, x, 3, -2*im*a^2*x - (2*a^2*log(cos(c + d*x)))/d + (im*a^2*tan(c + d*x))/d + (a + im*a*tan(c + d*x))^2/(2*d)]
    @test_int [(a + im*a*tan(c + d*x))^2, x, 2, 2*a^2*x - ((2*im)*a^2*log(cos(c + d*x)))/d - (a^2*tan(c + d*x))/d]
    @test_int [cot(c + d*x)*(a + im*a*tan(c + d*x))^2, x, 3, (2*im)*a^2*x + (a^2*log(cos(c + d*x)))/d + (a^2*log(sin(c + d*x)))/d]
    @test_int [cot(c + d*x)^2*(a + im*a*tan(c + d*x))^2, x, 3, -2*a^2*x - (a^2*cot(c + d*x))/d + ((2*im)*a^2*log(sin(c + d*x)))/d]
    @test_int [cot(c + d*x)^3*(a + im*a*tan(c + d*x))^2, x, 4, (-2*im)*a^2*x - ((2*im)*a^2*cot(c + d*x))/d - (a^2*cot(c + d*x)^2)/(2*d) - (2*a^2*log(sin(c + d*x)))/d]
    @test_int [cot(c + d*x)^4*(a + im*a*tan(c + d*x))^2, x, 5, 2*a^2*x + (2*a^2*cot(c + d*x))/d - (im*a^2*cot(c + d*x)^2)/d - (a^2*cot(c + d*x)^3)/(3*d) - ((2*im)*a^2*log(sin(c + d*x)))/d]
    @test_int [cot(c + d*x)^5*(a + im*a*tan(c + d*x))^2, x, 6, (2*im)*a^2*x + ((2*im)*a^2*cot(c + d*x))/d + (a^2*cot(c + d*x)^2)/d - (((2*im)/3)*a^2*cot(c + d*x)^3)/d - (a^2*cot(c + d*x)^4)/(4*d) + (2*a^2*log(sin(c + d*x)))/d]
    @test_int [cot(c + d*x)^6*(a + im*a*tan(c + d*x))^2, x, 7, -2*a^2*x - (2*a^2*cot(c + d*x))/d + (im*a^2*cot(c + d*x)^2)/d + (2*a^2*cot(c + d*x)^3)/(3*d) - ((im/2)*a^2*cot(c + d*x)^4)/d - (a^2*cot(c + d*x)^5)/(5*d) + ((2*im)*a^2*log(sin(c + d*x)))/d]


    @test_int [tan(c + d*x)^3*(a + im*a*tan(c + d*x))^3, x, 6, (4*im)*a^3*x + (4*a^3*log(cos(c + d*x)))/d - ((4*im)*a^3*tan(c + d*x))/d + (2*a^3*tan(c + d*x)^2)/d + (((4*im)/3)*a^3*tan(c + d*x)^3)/d - (11*a^3*tan(c + d*x)^4)/(20*d) - (tan(c + d*x)^4*(a^3 + im*a^3*tan(c + d*x)))/(5*d)]
    @test_int [tan(c + d*x)^2*(a + im*a*tan(c + d*x))^3, x, 4, -4*a^3*x + ((4*im)*a^3*log(cos(c + d*x)))/d + (2*a^3*tan(c + d*x))/d - ((im/2)*a*(a + im*a*tan(c + d*x))^2)/d - ((im/4)*(a + im*a*tan(c + d*x))^4)/(a*d)]
    @test_int [tan(c + d*x)*(a + im*a*tan(c + d*x))^3, x, 4, (-4*im)*a^3*x - (4*a^3*log(cos(c + d*x)))/d + ((2*im)*a^3*tan(c + d*x))/d + (a*(a + im*a*tan(c + d*x))^2)/(2*d) + (a + im*a*tan(c + d*x))^3/(3*d)]
    @test_int [(a + im*a*tan(c + d*x))^3, x, 3, 4*a^3*x - ((4*im)*a^3*log(cos(c + d*x)))/d - (2*a^3*tan(c + d*x))/d + ((im/2)*a*(a + im*a*tan(c + d*x))^2)/d]
    @test_int [cot(c + d*x)*(a + im*a*tan(c + d*x))^3, x, 5, (4*im)*a^3*x + (3*a^3*log(cos(c + d*x)))/d + (a^3*log(sin(c + d*x)))/d - (a^3 + im*a^3*tan(c + d*x))/d]
    @test_int [cot(c + d*x)^2*(a + im*a*tan(c + d*x))^3, x, 5, -4*a^3*x + (im*a^3*log(cos(c + d*x)))/d + ((3*im)*a^3*log(sin(c + d*x)))/d - (cot(c + d*x)*(a^3 + im*a^3*tan(c + d*x)))/d]
    @test_int [cot(c + d*x)^3*(a + im*a*tan(c + d*x))^3, x, 4, (-4*im)*a^3*x - ((2*im)*a^3*cot(c + d*x))/d - (4*a^3*log(sin(c + d*x)))/d - (a*cot(c + d*x)^2*(a + im*a*tan(c + d*x))^2)/(2*d)]
    @test_int [cot(c + d*x)^4*(a + im*a*tan(c + d*x))^3, x, 5, 4*a^3*x + (2*a^3*cot(c + d*x))/d - ((4*im)*a^3*log(sin(c + d*x)))/d - ((im/2)*a*cot(c + d*x)^2*(a + im*a*tan(c + d*x))^2)/d - (cot(c + d*x)^3*(a + im*a*tan(c + d*x))^3)/(3*d)]
    @test_int [cot(c + d*x)^5*(a + im*a*tan(c + d*x))^3, x, 6, (4*im)*a^3*x + ((4*im)*a^3*cot(c + d*x))/d + (2*a^3*cot(c + d*x)^2)/d - (((3*im)/4)*a^3*cot(c + d*x)^3)/d + (4*a^3*log(sin(c + d*x)))/d - (cot(c + d*x)^4*(a^3 + im*a^3*tan(c + d*x)))/(4*d)]
    @test_int [cot(c + d*x)^6*(a + im*a*tan(c + d*x))^3, x, 7, -4*a^3*x - (4*a^3*cot(c + d*x))/d + ((2*im)*a^3*cot(c + d*x)^2)/d + (4*a^3*cot(c + d*x)^3)/(3*d) - (((11*im)/20)*a^3*cot(c + d*x)^4)/d + ((4*im)*a^3*log(sin(c + d*x)))/d - (cot(c + d*x)^5*(a^3 + im*a^3*tan(c + d*x)))/(5*d)]


    @test_int [tan(c + d*x)^3*(a + im*a*tan(c + d*x))^4, x, 7, (8*im)*a^4*x + (8*a^4*log(cos(c + d*x)))/d - ((8*im)*a^4*tan(c + d*x))/d + (4*a^4*tan(c + d*x)^2)/d + (((8*im)/3)*a^4*tan(c + d*x)^3)/d - (67*a^4*tan(c + d*x)^4)/(60*d) - (tan(c + d*x)^4*(a^2 + im*a^2*tan(c + d*x))^2)/(6*d) - (7*tan(c + d*x)^4*(a^4 + im*a^4*tan(c + d*x)))/(15*d)]
    @test_int [tan(c + d*x)^2*(a + im*a*tan(c + d*x))^4, x, 5, -8*a^4*x + ((8*im)*a^4*log(cos(c + d*x)))/d + (4*a^4*tan(c + d*x))/d - ((im/3)*a*(a + im*a*tan(c + d*x))^3)/d - ((im/5)*(a + im*a*tan(c + d*x))^5)/(a*d) - (im*(a^2 + im*a^2*tan(c + d*x))^2)/d]
    @test_int [tan(c + d*x)*(a + im*a*tan(c + d*x))^4, x, 5, (-8*im)*a^4*x - (8*a^4*log(cos(c + d*x)))/d + ((4*im)*a^4*tan(c + d*x))/d + (a*(a + im*a*tan(c + d*x))^3)/(3*d) + (a + im*a*tan(c + d*x))^4/(4*d) + (a^2 + im*a^2*tan(c + d*x))^2/d]
    @test_int [(a + im*a*tan(c + d*x))^4, x, 4, 8*a^4*x - ((8*im)*a^4*log(cos(c + d*x)))/d - (4*a^4*tan(c + d*x))/d + ((im/3)*a*(a + im*a*tan(c + d*x))^3)/d + (im*(a^2 + im*a^2*tan(c + d*x))^2)/d]
    @test_int [cot(c + d*x)*(a + im*a*tan(c + d*x))^4, x, 6, (8*im)*a^4*x + (7*a^4*log(cos(c + d*x)))/d + (a^4*log(sin(c + d*x)))/d - (a^2 + im*a^2*tan(c + d*x))^2/(2*d) - (3*(a^4 + im*a^4*tan(c + d*x)))/d]
    @test_int [cot(c + d*x)^2*(a + im*a*tan(c + d*x))^4, x, 5, -8*a^4*x + ((4*im)*a^4*log(cos(c + d*x)))/d + ((4*im)*a^4*log(sin(c + d*x)))/d - (cot(c + d*x)*(a^2 + im*a^2*tan(c + d*x))^2)/d]
    @test_int [cot(c + d*x)^3*(a + im*a*tan(c + d*x))^4, x, 6, (-8*im)*a^4*x - (a^4*log(cos(c + d*x)))/d - (7*a^4*log(sin(c + d*x)))/d - (cot(c + d*x)^2*(a^2 + im*a^2*tan(c + d*x))^2)/(2*d) - ((3*im)*cot(c + d*x)*(a^4 + im*a^4*tan(c + d*x)))/d]
    @test_int [cot(c + d*x)^4*(a + im*a*tan(c + d*x))^4, x, 5, 8*a^4*x + (4*a^4*cot(c + d*x))/d - ((8*im)*a^4*log(sin(c + d*x)))/d - (a*cot(c + d*x)^3*(a + im*a*tan(c + d*x))^3)/(3*d) - (im*cot(c + d*x)^2*(a^2 + im*a^2*tan(c + d*x))^2)/d]
    @test_int [cot(c + d*x)^5*(a + im*a*tan(c + d*x))^4, x, 6, (8*im)*a^4*x + ((4*im)*a^4*cot(c + d*x))/d + (8*a^4*log(sin(c + d*x)))/d - ((im/3)*a*cot(c + d*x)^3*(a + im*a*tan(c + d*x))^3)/d - (cot(c + d*x)^4*(a + im*a*tan(c + d*x))^4)/(4*d) + (cot(c + d*x)^2*(a^2 + im*a^2*tan(c + d*x))^2)/d]
    @test_int [cot(c + d*x)^6*(a + im*a*tan(c + d*x))^4, x, 7, -8*a^4*x - (8*a^4*cot(c + d*x))/d + ((4*im)*a^4*cot(c + d*x)^2)/d + (23*a^4*cot(c + d*x)^3)/(15*d) + ((8*im)*a^4*log(sin(c + d*x)))/d - (cot(c + d*x)^5*(a^2 + im*a^2*tan(c + d*x))^2)/(5*d) - (((3*im)/5)*cot(c + d*x)^4*(a^4 + im*a^4*tan(c + d*x)))/d]
    @test_int [cot(c + d*x)^7*(a + im*a*tan(c + d*x))^4, x, 8, (-8*im)*a^4*x - ((8*im)*a^4*cot(c + d*x))/d - (4*a^4*cot(c + d*x)^2)/d + (((8*im)/3)*a^4*cot(c + d*x)^3)/d + (67*a^4*cot(c + d*x)^4)/(60*d) - (8*a^4*log(sin(c + d*x)))/d - (cot(c + d*x)^6*(a^2 + im*a^2*tan(c + d*x))^2)/(6*d) - (((7*im)/15)*cot(c + d*x)^5*(a^4 + im*a^4*tan(c + d*x)))/d]


    #= ::Subsubsection::Closed:: =#
    #=m<0=#


    @test_int [tan(c + d*x)^6/(a + im*a*tan(c + d*x)), x, 6, (5*x)/(2*a) + ((3*im)*log(cos(c + d*x)))/(a*d) - (5*tan(c + d*x))/(2*a*d) + (((3*im)/2)*tan(c + d*x)^2)/(a*d) + (5*tan(c + d*x)^3)/(6*a*d) - (((3*im)/4)*tan(c + d*x)^4)/(a*d) - tan(c + d*x)^5/(2*d*(a + im*a*tan(c + d*x)))]
    @test_int [tan(c + d*x)^5/(a + im*a*tan(c + d*x)), x, 5, (((-5*im)/2)*x)/a + (2*log(cos(c + d*x)))/(a*d) + (((5*im)/2)*tan(c + d*x))/(a*d) + tan(c + d*x)^2/(a*d) - (((5*im)/6)*tan(c + d*x)^3)/(a*d) - tan(c + d*x)^4/(2*d*(a + im*a*tan(c + d*x)))]
    @test_int [tan(c + d*x)^4/(a + im*a*tan(c + d*x)), x, 4, (-3*x)/(2*a) - ((2*im)*log(cos(c + d*x)))/(a*d) + (3*tan(c + d*x))/(2*a*d) - (im*tan(c + d*x)^2)/(a*d) - tan(c + d*x)^3/(2*d*(a + im*a*tan(c + d*x)))]
    @test_int [tan(c + d*x)^3/(a + im*a*tan(c + d*x)), x, 3, (((3*im)/2)*x)/a - log(cos(c + d*x))/(a*d) - (((3*im)/2)*tan(c + d*x))/(a*d) - tan(c + d*x)^2/(2*d*(a + im*a*tan(c + d*x)))]
    @test_int [tan(c + d*x)^2/(a + im*a*tan(c + d*x)), x, 3, x/(2*a) + (im*log(cos(c + d*x)))/(a*d) - im/(2*d*(a + im*a*tan(c + d*x)))]
    @test_int [tan(c + d*x)^1/(a + im*a*tan(c + d*x)), x, 2, -((im*x)/(2*a)) - 1/(2*d*(a + im*a*tan(c + d*x)))]
    @test_int [(a + im*a*tan(c + d*x))^(-1), x, 2, x/(2*a) + (im/2)/(d*(a + im*a*tan(c + d*x)))]
    @test_int [cot(c + d*x)/(a + im*a*tan(c + d*x)), x, 4, ((-im/2)*x)/a + log(sin(c + d*x))/(a*d) + 1/(2*d*(a + im*a*tan(c + d*x)))]
    @test_int [cot(c + d*x)^2/(a + im*a*tan(c + d*x)), x, 4, (-3*x)/(2*a) - (3*cot(c + d*x))/(2*a*d) - (im*log(sin(c + d*x)))/(a*d) + cot(c + d*x)/(2*d*(a + im*a*tan(c + d*x)))]
    @test_int [cot(c + d*x)^3/(a + im*a*tan(c + d*x)), x, 5, (((3*im)/2)*x)/a + (((3*im)/2)*cot(c + d*x))/(a*d) - cot(c + d*x)^2/(a*d) - (2*log(sin(c + d*x)))/(a*d) + cot(c + d*x)^2/(2*d*(a + im*a*tan(c + d*x)))]
    @test_int [cot(c + d*x)^4/(a + im*a*tan(c + d*x)), x, 6, (5*x)/(2*a) + (5*cot(c + d*x))/(2*a*d) + (im*cot(c + d*x)^2)/(a*d) - (5*cot(c + d*x)^3)/(6*a*d) + ((2*im)*log(sin(c + d*x)))/(a*d) + cot(c + d*x)^3/(2*d*(a + im*a*tan(c + d*x)))]


    @test_int [tan(c + d*x)^6/(a + im*a*tan(c + d*x))^2, x, 6, (-25*x)/(4*a^2) - ((6*im)*log(cos(c + d*x)))/(a^2*d) + (25*tan(c + d*x))/(4*a^2*d) - ((3*im)*tan(c + d*x)^2)/(a^2*d) - (25*tan(c + d*x)^3)/(12*a^2*d) + (((3*im)/2)*tan(c + d*x)^4)/(a^2*d*(1 + im*tan(c + d*x))) - tan(c + d*x)^5/(4*d*(a + im*a*tan(c + d*x))^2)]
    @test_int [tan(c + d*x)^5/(a + im*a*tan(c + d*x))^2, x, 5, (((15*im)/4)*x)/a^2 - (4*log(cos(c + d*x)))/(a^2*d) - (((15*im)/4)*tan(c + d*x))/(a^2*d) - (2*tan(c + d*x)^2)/(a^2*d) + (((5*im)/4)*tan(c + d*x)^3)/(a^2*d*(1 + im*tan(c + d*x))) - tan(c + d*x)^4/(4*d*(a + im*a*tan(c + d*x))^2)]
    @test_int [tan(c + d*x)^4/(a + im*a*tan(c + d*x))^2, x, 4, (9*x)/(4*a^2) + ((2*im)*log(cos(c + d*x)))/(a^2*d) - (9*tan(c + d*x))/(4*a^2*d) + (im*tan(c + d*x)^2)/(a^2*d*(1 + im*tan(c + d*x))) - tan(c + d*x)^3/(4*d*(a + im*a*tan(c + d*x))^2)]
    @test_int [tan(c + d*x)^3/(a + im*a*tan(c + d*x))^2, x, 6, -((3*im*x)/(4*a^2)) + log(cos(c + d*x))/(a^2*d) - 3/(4*a^2*d*(1 + im*tan(c + d*x))) - tan(c + d*x)^2/(4*d*(a + im*a*tan(c + d*x))^2)]
